import React from 'react'
import { Component } from 'react'
// import { FacebookProvider, Page, Initialize } from 'react-facebook';

class Home extends Component {
    componentDidMount() {
        this.getData()
    }
    getData = () => {
        axios.get('https://node3.mobilesupportbot.com:5075/secure/pages/get/all')
            .then(res => console.log('pages ', res))
    }
    render() {
        return (
            <h1>home page</h1>
        )
    }
}

export default Home
